import React from "react";
import {Table} from 'antd';

const UsersPage = () => {
    return <Table columns={columns} dataSource={data}/>
};

const columns = [
    {
        title: 'Name',
        dataIndex: 'name',
        key: 'name',
        render: (text: string) => <a>{text}</a>,
    },
    {
        title: 'Nickname',
        dataIndex: 'age',
        key: 'age',
    },
    {
        title: 'Nickname',
        dataIndex: 'nickname',
        key: 'nickname',
    },
    {
        title: 'Action',
        key: 'action',
        render: (text: string, record: any) => (
            <span>
                <a style={{marginRight: 16}}>Invite {record.name}</a>
                <a>Delete</a>
            </span>
        )
    }
];

const data = [
    {
        key: '1',
        name: 'John Brown',
        nickname: "John Brown",
        email: "123@mail.com"
    },
    {
        key: '2',
        name: 'Jim Green',
        nickname: "Jim Green",
        email: "123@mail.com"
    },
    {
        key: '3',
        name: 'Joe Black',
        nickname: "Joe Black",
        email: "123@mail.com"
    },
];

export default UsersPage;
